`,Fe(t.p,{children:"随着深度神经网络的日益普及，后门攻击的日益盛行对其安全性构成了重大威胁。现有的后门攻击大多为脏标签攻击，很容易通过人工检测发现，而干净标签攻击具有更强的隐蔽性。然而，在严格约束条件下进行有效的干净标签攻击仍然是一个重大挑战。本文发现数据投毒过程中样本的选择策略对干净标签攻击有效性的影响至关重要。本文引入了一种新型干净标签后门攻击框架，该框架利用特征对齐来加强源标签样本与目标标签之间的关联，通过计算目标标签样本的特征质心，并将源标签样本的特征与这些质心对齐，显著提升了攻击成功率。在多个基准数据集上进行的一系列实验表明，本文所提出的方法在严格的约束条件下（低中毒率和有限的扰动预算）表现优于现有的干净标签后门攻击，同时在现实场景中对良性样本保持了较高的准确性。此外，本文中所提出的方法对后门防御有较好的鲁棒性，凸显了其潜在威胁。"})]})}function ive(e={}){const{wrapper:t}=e.components||{};return t?Fe(t,{...e,children:Fe(BC,{...e})}):BC(e)}const sve={__name:"Abstract",setup(e){return(t,n)=>{const r=Ze("el-divider"),a=Ze("el-col"),o=Ze("el-row");return N(),X("div",null,[G(r),G(o,{justify:"center"},{default:te(()=>[G(a,{xs:24,sm:20,md:16,lg:12,xl:12},{default:te(()=>[G(h(ive))]),_:1})]),_:1})])}}};function zC(e){const t={a:"a",annotation:"annotation",blockquote:"blockquote",code:"code",del:"del",h1:"h1",h2:"h2",h3:"h3",img:"img",input:"input",li:"li",math:"math",mfrac:"mfrac",mi:"mi",mn:"mn",mo:"mo",mrow:"mrow",msub:"msub",msup:"msup",ol:"ol",p:"p",pre:"pre",semantics:"semantics",span:"span",strong:"strong",table:"table",tbody:"tbody",td:"td",th:"th",thead:"thead",tr:"tr",ul:"ul",...e.components};return Fe(dt,{children:[Fe(t.h1,{children:"Methodology"}),`
